import React from "react";
import "../stylesheets/App.scss";
import "../stylesheets/ClubList.scss";
import "../stylesheets/Club.scss";
import data from "../data/clubs.json";

data = clubs;

const App = () => {
  return (
    <div className="App">
      <ul className="list">
        {clubs.map((eachClub) => {
          return (
            <li className="list__item">
              <i className={eachClub.fa} />
              <div>
                <h2 className="item__title">{eachClub.name}</h2>{" "}
                <ul item__members>
                  Members:<li>{eachClub.members.join(" , ")}</li>{" "}
                </ul>
              </div>
            </li>
          );
        })}
      </ul>
    </div>
  );
};

export default App;
